INSERT INTO `email_notification` VALUES (1,'<p>Votre compte utilisateur sur {{nom_app}} a été créé avec succès.<br>Vous pouvez dès à présent vous connecter sur la plateforme accessible à l\'adresse suivante : {{lien_app}}</p><p>Veuillez trouver ci-dessous vos identifiants de connexion :<br><span style=\"font-style:italic;\">(Ceux-ci sont valables {{delai_validite}}, passé ce délai, vous devrez recommencer le processus d\'inscription.)</span></p><ul><li>Login : {{login}}</li><li>Mot de passe : {{mot_de_passe}}</li></ul><p>Une fois connecté·e, il vous sera demandé de définir un nouveau mot de passe. Cette action est nécessaire pour finaliser votre inscription.<br>Cet email a été envoyé automatiquement, merci de ne pas y répondre.</p><p>L\'équipe Impulsa</p>            ',4870290,'Finalisez votre inscription','[\"nom_app\", \"lien_app\", \"delai_validite\", \"login\", \"mot_de_passe\"]','user_bo_register_credentials'),(2,'<p>Nous avons bien réceptionné votre demande de réinitialisation de mot de passe sur {{nom_app}}.<br>Si vous n\'êtes pas à l\'origine de cette demande, merci de ne pas tenir compte de cet email.</p><p>Veuillez trouver ci-dessous votre code confidentiel à usage unique :<br><span style=\"font-style:italic;\">(Celui-ci est valable {{delai_validite}}, passé ce délai, vous devrez recommencer le processus de réinitialisation.)</span></p><p style=\"margin:25px 0;font-size:1.3em;font-weight:bold;\"><span style=\"border:1px solid #555;border-radius:5px;padding:15px;\">{{code}}</span></p><p>Ce code vous sera demandé pour finaliser la réinitialisation de votre mot de passe.<br>Cet email a été envoyé automatiquement, merci de ne pas y répondre.</p><p>L\'équipe Impulsa</p>',4870290,'Réinitialisation de votre mot de passe','[\"nom_app\", \"delai_validite\", \"code\"]','user_bo_reset_password_verification_code'),(3,'Bonjour {{prenom_utilisateur}},\n\nPeux-tu me fournir les éléments suivants stp :\n\n- Attestation SS\n- RIB\n- Carte d\'identité\n\nMerci de ton retour',4870290,'Demande de transmision RIB / Carte d\'identité / Attestation d\'assur. maladie','[\"prenom_utilisateur\"]','user_bo_onboard_hiring_documents_request'),(4,'Bonjour {{prenom_utilisateur}},\n\nPeux-tu me transmettre les coordonnées de ton école :\n\n- Adresse email\n- Nom de l\'école\n- Numéro de téléphone\n\nBien à toi',4870290,'Demande de transmission convention de formation','[\"prenom_utilisateur\"]','user_bo_onboard_agreement_transmission_request'),(5,'Bonjour {{prenom_utilisateur}},\n\nPeux-tu me renvoyer les documents listés ci-dessous signés ?\n\n- Convention de formation\n- CERFA\n\nMerci d\'avance',4870290,'Signature de la convention de formation / CERFA','[\"prenom_utilisateur\"]','user_bo_onboard_agreement_signature_request'),(6,'Bonjour {{prenom_utilisateur}},\n\nTu trouveras ton contrat en PJ.\n\nJe te laisse en prendre connaissance et me le renvoyer signé.\n\nMerci d\'avance',4870290,'Demande de signature du contrat','[\"prenom_utilisateur\"]','user_bo_onboard_contract_signature_request'),(7,'Bonjour {{prenom_utilisateur}},\n\nTout d\'abord, je tiens à te souhaiter la bienvenue au sein d\'IMPULSA !\nJe te rappelle qu\'il convient de :\n- saisir chaque jour tes temps via le logiciel CEGID\n- saisir les frais sur SILAE et de me transmettre les justificatifs du mois précédent avant le 15 de chaque mois\n\nPar ailleurs, afin de faire l\'affiliation à la mutuelle AXA j\'ai besoin de :\n- m\'indiquer si tu es cadre ou non cadre\n- adresse mail perso\n- adresse postale\n(les bénéficiaires (conjoint ou enfants) devront être ajoutés par vous-même sur votre compte AXA).\n\nTa carte de mutuelle arrivera à ton adresse postale.\nConcernant les bulletins de salaires, ils seront disponibles sur l\'application EDOC, tu vas recevoir un mail à la fin du mois afin d\'activer ton compte.\nDe plus, la carte ticket restau (Apetiz) arrivera bientôt à {{site}}. Celle-ci est limitée à 25 € par jour et rechargée à chaque fin de mois (8,50€/jour).\nEt enfin, tu trouveras ci-joint la procédure RH.\n\nJe reste à ta disposition pour toutes informations complémentaires,\n\nBien cordialement\n',4870290,'Envoi du mail brief Mutuelle  / Apetiz / EDOC','[\"prenom_utilisateur\", \"site\"]','user_bo_onboard_mutual_insurance_apetiz_edoc'),(8,'Bonjour,\n\nLe client {{code_client}} {{nom_client}} doit {{montant_dette}} €.\nMerci de ne pas lui transmettre d\'éléments avant mon feu vert.\n\nMerci d\'avance',4870290,'Account - Offboard','[\"code_client\", \"nom_client\", \"montant_dette\"]','account_offboard_internal_notification_blocking_transmission'),(9,'Madame, Monsieur {{nom_contact_client}},\n\nNous avons bien reçu votre lettre du {{date_courrier}}, nous informant de votre décision de mettre fin à notre collaboration à compter du {{date_fin_collaboration}}.\nNous en prenons bonne note tout en regrettant votre décision.\nCependant, nous vous rappelons que votre compte en nos livres présente un solde débiteur de {{montant_dette}} €.\nNous vous remercions par avance de votre règlement dans les tous prochains jours.\n\nNous vous prions de croire, Madame, Monsieur, à l\'assurance de nos sentiments les meilleurs.',4870290,'Account - Offboard','[\"date_courrier\", \"nom_contact_client\", \"date_fin_collaboration\", \"montant_dette\"]','account_offboard_end_collaboration_pay_your_balance'),(10,'Monsieur {{nom_contact_client}} et Cher Confrère,\n\nNous accusons réception de votre courrier du {{date_courrier}} relatif à votre entrée en fonction sur le dossier de notre client {{nom_client}} à compter du {{date_debut}}.\nNous vous précisons que nous n\'avons pas été réglés du solde de nos honoraires dont le montant s\'élève à la somme de {{montant_dette}} €.\nPar conséquent, nous vous remercions de bien vouloir faire les réserves nécessaires auprès de M. {{nom_contact_client}}.\nVous souhaitant bonne réception du présent courrier,\n\nNous vous prions de croire, Monsieur et Cher Confrère, à l\'assurance de nos confraternelles salutations.',4870290,'Account - Offboard','[\"date_courrier\", \"nom_client\", \"date_debut\", \"montant_dette\"]','account_offboard_account_cannot_be_transferred'),(11,'Madame, Monsieur {{nom_contact_client}},\n\nNous avons bien reçu votre lettre du {{date_courrier}}, nous informant de votre décision de mettre fin à notre collaboration à compter du {{date_fin_collaboration}}.\nCependant, nous vous informons que le délai maximum de demande de résiliation était au {{date_delai_max}} (3 mois avant la date de clôture de l\'exercice comptable).\nComme indiqué sur la lettre de mission, en cas de résiliation au cours d\'un exercice comptable, et sauf faute grave imputable au professionnel de l\'expertise comptable, le client devra verser à ce dernier les honoraires dus pour le travail déjà effectué, majorés d\'une indemnité conventionnelle égale à 25 % des honoraires annuels convenus pour l\'exercice en cours ou de la dernière année d\'honoraires en cas de montant incertain.\nNous en prenons bonne note tout en regrettant votre décision.\n\nNous vous prions de croire, Madame, Monsieur, à l\'assurance de nos sentiments les meilleurs.',4870290,'Account - Offboard','[\"date_courrier\", \"nom_contact_client\", \"date_fin_collaboration\", \"date_delai_max\"]','account_offboard_cancellation_period_not_respected'),(12,'Madame, Monsieur {{nom_contact_client}},\n\nNous avons bien reçu votre lettre du {{date_courrier}}, nous informant de votre décision de mettre fin à notre collaboration à compter du {{date_fin_collaboration}}.\nNous en prenons bonne note tout en regrettant votre décision.\n\nNous vous prions de croire, Madame, Monsieur, à l\'assurance de nos sentiments les meilleurs.',4870290,'Account - Offboard','[\"date_courrier\", \"nom_contact_client\", \"date_fin_collaboration\"]','account_offboard_good_continuation'),(13,'Monsieur SORTI@X.FR et Cher Confrère,\n\nNous accusons réception de votre courrier du 01/01/1900 relatif à votre entrée en fonction sur le dossier de notre client BOUCHERIE CHIRAUX à compter du 01/01/1900.\nNous n\'avons pas d\'objection à formuler en ce qui concerne votre entrée en fonction sur ce dossier, et nous nous tenons à votre disposition afin d\'operer la transmission des divers éléments de ce dernier.\nVous souhaitant bonne réception du présent courrier,\n\nNous vous prions de croire, Monsieur et Cher Confrère, à l\'assurance de nos confraternelles salutations.',4870290,'Account - Offboard','[\"date_courrier\", \"nom_contact_client\", \"date_reprise\"]','account_offboard_account_transfer'),(14,'Madame, Monsieur {{nom_contact_client}},\n\nNous avons bien reçu votre paiement visant à régulariser vos impayés à date du {{date}}.\n\nNous vous prions de croire, Madame, Monsieur, à l\'assurance de nos sentiments les meilleurs.',4870290,'Account - Offboard','[\"date\", \"nom_contact_client\"]','account_offboard_payment_confirmation'),(15,'Madame, Monsieur {{nom_contact_client}},\n\nVous trouverez ci-joint la lettre de mission à dater, à signer svp. Je reste à votre disposition pour toutes informations complémentaires.\n\nMerci d\'avance',4870290,'Lead - Onboard','[\"nom_contact_client\"]','lead_onboard_mission_letter'),(16,'Madame, Monsieur {{nom_contact_client}},\n\nPourriez-vous nous transmettre votre RIB afin de finaliser votre onboarding ?\n\nMerci d\'avance',4870290,'Lead - Onboard','[\"nom_contact_client\"]','lead_onboard_documents_request'),(17,'Madame, Monsieur {{nom_contact_client}} et Cher Confrère, Chère Consœur,\n\nNous avons été sollicités par Mme/M. {{nom_contact_client}}, pour assurer une mission de présentation des comptes annuels à compter du {{date_debut}} des sociétés suivantes :\n- {{nom_client}}\n\nConformément à l\'article 14 de notre Code des devoirs professionnels, nous vous prions de bien vouloir nous faire savoir si rien ne s\'oppose à notre entrée en fonction sur ce dossier.\n\nAfin de reprendre la suite de ce dossier, vous voudrez bien tenir à notre disposition tous les documents qui nous permettront d\'assurer notre mission.\n\nVous souhaitant bonne réception du présent courrier,\n\nNous vous prions de croire, Madame, Monsieur et Cher Confrère, Chère Consœur, à l\'assurance de nos sentiments les meilleurs.',4870290,'Lead - Onboard','[\"nom_contact_client\", \"nom_client\", \"date_debut\"]','lead_onboard_business_acquisition'),(18,'Madame, Monsieur {{nom_contact_client}},\n\nPourriez-vous me transmettre le KBIS de la société afin de finaliser votre onboarding ?\n\nMerci d\'avance pour votre retour ',4870290,'Lead - Onboard','[\"nom_contact_client\"]','lead_onboard_kbis_request'),(19,'Bonjour,\n\nVeuillez trouver ci-joint les extraits de KBIS pour la structure du lead {{nom_lead}}.\n\nBien à vous',4870290,'Lead - Onboard','[\"nom_lead\"]','lead_onboard_kbis_sending'),(20,'Madame, Monsieur {{nom_contact_client}},\n\nPourriez-vous activer le lien Impotgouv suivant : {{lien_impot_gouv}} ?\n\nMerci d\'avance',4870290,'Account - Onboard','[\"nom_contact_client\", \"lien_impot_gouv\"]','account_onboard_link_sending'),(21,'Madame, Monsieur {{nom_contact_client}},\n\nPourriez-vous nous renvoyer ce mandat de prélèvelement bancaire signé ?\n\nMerci d\'avance',4870290,'Account - Onboard','[\"nom_contact_client\"]','account_onboard_direct_debit_mandate_signature');
/*!40000 ALTER TABLE `email_notification` ENABLE KEYS */;
UNLOCK TABLES;

