INSERT INTO `notification_template` VALUES (3,'<p>Votre compte utilisateur sur {{nom_app}} a été créé avec succès.<br>Vous pouvez dès à présent vous connecter sur la plateforme accessible à l\'adresse suivante : {{lien_app}}</p><p>Veuillez trouver ci-dessous vos identifiants de connexion :<br><span style=\"font-style:italic;\">(Ceux-ci sont valables {{delai_validite}}, passé ce délai, vous devrez recommencer le processus d\'inscription.)</span></p><ul><li>Login : {{login}}</li><li>Mot de passe : {{mot_de_passe}}</li></ul><p>Une fois connecté·e, il vous sera demandé de définir un nouveau mot de passe. Cette action est nécessaire pour finaliser votre inscription.<br>Cet email a été envoyé automatiquement, merci de ne pas y répondre.</p><p>L\'équipe Impulsa</p>            ',1,'2022-01-05 15:19:23','[]',NULL,'[]',0,'4870290','Finalisez votre inscription',NULL),(4,'<p>Nous avons bien réceptionné votre demande de réinitialisation de mot de passe sur {{nom_app}}.<br>Si vous n\'êtes pas à l\'origine de cette demande, merci de ne pas tenir compte de cet email.</p><p>Veuillez trouver ci-dessous votre code confidentiel à usage unique :<br><span style=\"font-style:italic;\">(Celui-ci est valable {{delai_validite}}, passé ce délai, vous devrez recommencer le processus de réinitialisation.)</span></p><p style=\"margin:25px 0;font-size:1.3em;font-weight:bold;\"><span style=\"border:1px solid #555;border-radius:5px;padding:15px;\">{{code}}</span></p><p>Ce code vous sera demandé pour finaliser la réinitialisation de votre mot de passe.<br>Cet email a été envoyé automatiquement, merci de ne pas y répondre.</p><p>L\'équipe Impulsa</p>',1,'2022-01-05 15:19:23','[]',NULL,'[]',0,'4870290','Réinitialisation de votre mot de passe',NULL),(5,'Le client {{code_client}} - {{nom_client}} n\'a pas encore fourni les pièces nécessaires pour le traitement de son dossier suivi de production comptable : revue.',1,'2022-01-05 15:19:24','[]',NULL,'[]',0,'4870290','Réponse client en attente',NULL),(6,'La tâche affectée à {{trigram}} a été réalisée.',1,'2022-01-24 16:58:24','[]',NULL,'[]',0,'4870290','Tâche réalisée',NULL),(7,'Le frais exceptionnel \"{{article}}\" de la facture du {{date_facture}} pour le client {{code_client}} - {{nom_client}} a été rejeté.\r\n<br/>Commentaire associé :\r\n<br/>{{commentaire}} ',1,'2022-05-20 09:33:17','[]',NULL,'[]',0,'4870290','Frais exceptionnel rejeté',NULL),(8,'Le frais contractuel \"{{article}}\" de la facture du {{date_facture}} pour le client {{code_client}} - {{nom_client}} a été rejeté.\r\n<br/>Commentaire associé :\r\n<br/>{{commentaire}} ',1,'2022-05-20 09:33:17','[]',NULL,'[]',0,'4870290','Frais contractuel rejeté',NULL),(9,'Une tâche vous a été assignée.',1,'2022-11-03 20:13:42','[]',NULL,'[]',0,'4870290','Tâche assignée',NULL),(10,'Bonjour {{prenom_utilisateur}},\r\n\r\nPeux-tu me fournir les éléments suivants stp :\r\n\r\n- Attestation SS\r\n- RIB\r\n- Carte d\'identité\r\n\r\nMerci de ton retour',1,'2023-02-15 18:11:45','[]',NULL,'[]',0,'4870290','Demande de transmision RIB / Carte d\'identité / Attestation d\'assur. maladie',NULL),(11,'Bonjour {{prenom_utilisateur}},\r\n\r\nPeux-tu me transmettre les coordonnées de ton école :\r\n\r\n- Adresse email \r\n- Nom de l\'école \r\n- Numéro de téléphone\r\n\r\nBien à toi',1,'2023-02-15 18:11:45','[]',NULL,'[]',0,'4870290','Demande de transmission convention de formation',NULL),(12,'Bonjour {{prenom_utilisateur}},\r\n\r\nPeux-tu me renvoyer les documents listés ci-dessous signés ?\r\n\r\n- Convention de formation\r\n- CERFA\r\n\r\nMerci d\'avance',1,'2023-02-15 18:11:45','[]',NULL,'[]',0,'4870290','Signature de la convention de formation / CERFA',NULL),(13,'Bonjour {{prenom_utilisateur}},\r\n\r\nTu trouveras ton contrat en PJ.\r\n\r\nJe te laisse en prendre connaissance et me le renvoyer signé. \r\n\r\nMerci d\'avance',1,'2023-02-15 18:11:45','[]',NULL,'[]',0,'4870290','Demande de signature du contrat',NULL),(14,'Contrat de l\'utilisateur {{nom_utilisateur}} signé et deposé dans l\'espace \"Onboarding\".',1,'2023-02-15 18:11:45','[]',NULL,'[]',0,'4870290','Production RH - Onboard',NULL),(15,'Bonjour {{prenom_utilisateur}},\r\n\r\nTout d\'abord, je tiens à te souhaiter la bienvenue au sein d\'IMPULSA !\r\nJe te rappelle qu\'il convient de :\r\n- saisir chaque jour tes temps via le logiciel CEGID\r\n- saisir les frais sur SILAE et de me transmettre les justificatifs du mois précédent avant le 15 de chaque mois\r\n\r\nPar ailleurs, afin de faire l\'affiliation à la mutuelle AXA j\'ai besoin de :\r\n- m\'indiquer si tu es cadre ou non cadre\r\n- adresse mail perso\r\n- adresse postale\r\n(les bénéficiaires (conjoint ou enfants) devront être ajoutés par vous-même sur votre compte AXA).\r\n\r\nTa carte de mutuelle arrivera à ton adresse postale.\r\nConcernant les bulletins de salaires, ils seront disponibles sur l\'application EDOC, tu vas recevoir un mail à la fin du mois afin d\'activer ton compte.\r\nDe plus, la carte ticket restau (Apetiz) arrivera bientôt à {{site}}. Celle-ci est limitée à 25 € par jour et rechargée à chaque fin de mois (8,50€/jour).\r\nEt enfin, tu trouveras ci-joint la procédure RH.\r\n\r\nJe reste à ta disposition pour toutes informations complémentaires,\r\n\r\nBien cordialement\r\n',1,'2023-02-15 18:11:45','[]',NULL,'[]',0,'4870290','Envoi du mail brief Mutuelle  / Apetiz / EDOC',NULL),(16,'Clôture CEGID effectuée pour l\'utilisateur {{nom_utilisateur}}.',1,'2023-02-15 18:11:45','[]',NULL,'[]',0,'4870290','Production RH - Offboard',NULL),(17,'Clôture SILAE effectuée pour l\'utilisateur {{nom_utilisateur}}.',1,'2023-02-15 18:11:45','[]',NULL,'[]',0,'4870290','Production RH - Offboard',NULL),(18,'Le dossier {{code_client}} {{nom_client}} est endetté merci de ne pas répondre aux demandes de transmission du dossier.',1,'2023-02-15 18:12:51','[]',NULL,'[]',0,'4870290','Account - Offboard',NULL),(19,'Bonjour,\r\n\r\nLe client {{code_client}} {{nom_client}} doit {{montant_dette}} €.\r\nMerci de ne pas lui transmettre d\'éléments avant mon feu vert. \r\n\r\nMerci d\'avance',1,'2023-02-15 18:12:51','[]',NULL,'[]',0,'4870290','Account - Offboard',NULL),(20,'Madame, Monsieur {{nom_contact_client}},\r\n\r\nNous avons bien reçu votre lettre du {{date_courrier}}, nous informant de votre décision de mettre fin à notre collaboration à compter du {{date_fin_collaboration}}. \r\nNous en prenons bonne note tout en regrettant votre décision. \r\nCependant, nous vous rappelons que votre compte en nos livres présente un solde débiteur de {{montant_dette}} €.\r\nNous vous remercions par avance de votre règlement dans les tous prochains jours.\r\n\r\nNous vous prions de croire, Madame, Monsieur, à l\'assurance de nos sentiments les meilleurs.',1,'2023-02-15 18:12:51','[]',NULL,'[]',0,'4870290','Account - Offboard',NULL),(21,'Monsieur {{nom_contact_client}} et Cher Confrère,\r\n\r\nNous accusons réception de votre courrier du {{date_courrier}} relatif à votre entrée en fonction sur le dossier de notre client {{nom_client}} à compter du {{date_debut}}.\r\nNous vous précisons que nous n\'avons pas été réglés du solde de nos honoraires dont le montant s\'élève à la somme de {{montant_dette}} €.\r\nPar conséquent, nous vous remercions de bien vouloir faire les réserves nécessaires auprès de M. {{nom_contact_client}}.\r\nVous souhaitant bonne réception du présent courrier,\r\n\r\nNous vous prions de croire, Monsieur et Cher Confrère, à l\'assurance de nos confraternelles salutations.',1,'2023-02-15 18:12:51','[]',NULL,'[]',0,'4870290','Account - Offboard',NULL),(22,'Madame, Monsieur {{nom_contact_client}},\r\n\r\nNous avons bien reçu votre lettre du {{date_courrier}}, nous informant de votre décision de mettre fin à notre collaboration à compter du {{date_fin_collaboration}}. \r\nCependant, nous vous informons que le délai maximum de demande de résiliation était au {{date_delai_max}} (3 mois avant la date de clôture de l\'exercice comptable).\r\nComme indiqué sur la lettre de mission, en cas de résiliation au cours d\'un exercice comptable, et sauf faute grave imputable au professionnel de l\'expertise comptable, le client devra verser à ce dernier les honoraires dus pour le travail déjà effectué, majorés d\'une indemnité conventionnelle égale à 25 % des honoraires annuels convenus pour l\'exercice en cours ou de la dernière année d\'honoraires en cas de montant incertain.\r\nNous en prenons bonne note tout en regrettant votre décision. \r\n\r\nNous vous prions de croire, Madame, Monsieur, à l\'assurance de nos sentiments les meilleurs.',1,'2023-02-15 18:12:51','[]',NULL,'[]',0,'4870290','Account - Offboard',NULL),(23,'Madame, Monsieur {{nom_contact_client}},\r\n\r\nNous avons bien reçu votre lettre du {{date_courrier}}, nous informant de votre décision de mettre fin à notre collaboration à compter du {{date_fin_collaboration}}. \r\nNous en prenons bonne note tout en regrettant votre décision. \r\n\r\nNous vous prions de croire, Madame, Monsieur, à l\'assurance de nos sentiments les meilleurs.',1,'2023-02-15 18:12:51','[]',NULL,'[]',0,'4870290','Account - Offboard',NULL),(24,'Monsieur {{nom_contact_client}} et Cher Confrère,\r\n\r\nNous accusons réception de votre courrier du {{date_courrier}} relatif à votre entrée en fonction sur le dossier de notre client {{nom_client}} à compter du {{date_reprise}}.\r\nNous n\'avons pas d\'objection à formuler en ce qui concerne votre entrée en fonction sur ce dossier, et nous nous tenons à votre disposition afin d\'operer la transmission des divers éléments de ce dernier.\r\nVous souhaitant bonne réception du présent courrier, \r\n\r\nNous vous prions de croire, Monsieur et Cher Confrère, à l\'assurance de nos confraternelles salutations.',1,'2023-02-15 18:12:51','[]',NULL,'[]',0,'4870290','Account - Offboard',NULL),(25,'Madame, Monsieur {{nom_contact_client}},\r\n\r\nNous avons bien reçu votre paiement visant à régulariser vos impayés à date du {{date}}.\r\n\r\nNous vous prions de croire, Madame, Monsieur, à l\'assurance de nos sentiments les meilleurs.',1,'2023-02-15 18:12:51','[]',NULL,'[]',0,'4870290','Account - Offboard',NULL),(26,'Le dossier {{code_client}} {{nom_client}} a régularisé sa situation. ',1,'2023-02-15 18:12:51','[]',NULL,'[]',0,'4870290','Account - Offboard',NULL),(27,'Le process d\'offboarding du dossier {{code_client}} {{nom_client}} a été finalisé.',1,'2023-02-15 18:12:51','[]',NULL,'[]',0,'4870290','Account - Offboard',NULL),(28,'Un document (LM) à été envoyé pour signature concernant le lead {{nom_lead}}.',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Lead - Onboard',NULL),(29,'Le dossier client n°{{code_client}} a été créé.',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Lead - Onboard',NULL),(30,'Madame, Monsieur {{nom_contact_client}},\r\n\r\nVous trouverez ci-joint la lettre de mission à dater, à signer svp. Je reste à votre disposition pour toutes informations complémentaires. \r\n\r\nMerci d\'avance',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Lead - Onboard',NULL),(31,'Madame, Monsieur {{nom_contact_client}},\r\n\r\nPourriez-vous nous transmettre votre RIB afin de finaliser votre onboarding ?\r\n\r\nMerci d\'avance',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Lead - Onboard',NULL),(32,'Madame, Monsieur {{nom_contact_client}} et Cher Confrère, Chère Consœur,\r\n \r\nNous avons été sollicités par Mme/M. {{nom_contact_client}}, pour assurer une mission de présentation des comptes annuels à compter du {{date_debut}} des sociétés suivantes :\r\n- {{nom_client}}\r\n\r\nConformément à l\'article 14 de notre Code des devoirs professionnels, nous vous prions de bien vouloir nous faire savoir si rien ne s\'oppose à notre entrée en fonction sur ce dossier.\r\n \r\nAfin de reprendre la suite de ce dossier, vous voudrez bien tenir à notre disposition tous les documents qui nous permettront d\'assurer notre mission.\r\n \r\nVous souhaitant bonne réception du présent courrier,\r\n \r\nNous vous prions de croire, Madame, Monsieur et Cher Confrère, Chère Consœur, à l\'assurance de nos sentiments les meilleurs.',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Lead - Onboard',NULL),(33,'Madame, Monsieur {{nom_contact_client}},\r\n \r\nPourriez-vous me transmettre le KBIS de la société afin de finaliser votre onboarding ?\r\n \r\nMerci d\'avance pour votre retour ',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Lead - Onboard',NULL),(34,'Bonjour,\r\n\r\nVeuillez trouver ci-joint les extraits de KBIS pour la structure du lead {{nom_lead}}.\r\n\r\nBien à vous',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Lead - Onboard',NULL),(35,'Le dossier {{code_client}} {{nom_client}} vous à été attribué.',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Account - Onboard',NULL),(36,'Le dossier {{code_client}} {{nom_client}} vous à été attribué.',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Account - Onboard',NULL),(37,'Le dossier {{code_client}} {{nom_client}} vous à été attribué.',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Account - Onboard',NULL),(38,'Le dossier {{code_client}} {{nom_client}} vous à été attribué.',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Account - Onboard',NULL),(39,'Le dossier {{code_client}} {{nom_client}} vous à été attribué.',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Account - Onboard',NULL),(40,'Le(s) mandat(s) Impots du client {{code_client}} {{nom_client}} ont été signés.',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Account - Onboard',NULL),(41,'Le(s) mandat(s) Banque du client {{code_client}} {{nom_client}} ont été signés.',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Account - Onboard',NULL),(42,'Madame, Monsieur {{nom_contact_client}},\r\n\r\nPourriez-vous activer le lien Impotgouv suivant : {{lien_impot_gouv}} ?\r\n\r\nMerci d\'avance',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Account - Onboard',NULL),(43,'Le paramétrage du contrat du client {{code_client}} {{nom_client}} est fait.',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Account - Onboard',NULL),(44,'Madame, Monsieur {{nom_contact_client}},\r\n\r\nPourriez-vous nous renvoyer ce mandat de prélèvelement bancaire signé ? \r\n\r\nMerci d\'avance',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Account - Onboard',NULL),(45,' Le mandat de prélèvement du client {{code_client}} {{nom_client}} a été signé.',1,'2023-02-15 18:13:14','[]',NULL,'[]',0,'4870290','Account - Onboard',NULL);
